import React from "react";
import './App.css'
import {Route , Switch } from "react-router-dom"
import KuMap from "./components/KuMap";

function App(){
  return(
    <Switch>
      <Route exact path="/" component={KuMap}/>
    </Switch>
  )
}
export default App;
